/**
 * Enumerador de constantes de acciones del pokemón.
 */
export enum ActionsConstants{
    //Get pokemon
    GetPokemonAction = '[Pokemon] Get Pokemon Action',
    //Get success
    GetPokemonSuccessAction = '[Pokemon] Get Pokemon Success Action',
    //Set loading
    SetLoadingPokemonAction = '[Pokemon] Set Loading Pokemon Action',
}
